import axios from 'axios';

const API_BASE_URL = process.env.REACT_APP_API_BASE_URL || 'http://localhost:8080/api/1.0';

export const fetchCategoryData = async () => {
		
	try{
		const { data } = await axios.get('${API_BASE_URL}/categories');
		console.log(data);
		return { data };
	}catch(error){
		
	}
};
